import './App.css';

import React, { useState, useEffect } from "react";
import ReactDOM from 'react-dom';
import { VictoryLine, VictoryChart, VictoryTheme } from 'victory';

var url = 'https://api.coingecko.com/api/v3/coins/bitcoin/market_chart?vs_currency=gbp&days=14&interval=daily';



function App() {
  const [data, setData] = useState({});

  useEffect(() => {
    (async () => {
      const response = await fetch(
        "https://api.coingecko.com/api/v3/coins/bitcoin/market_chart?vs_currency=gbp&days=14&interval=daily"
      );
      const parsed = await response.json();
      setData(parsed);
    })();
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <div className='Graph'>
      <VictoryChart
  theme={VictoryTheme.material}
>
  <VictoryLine
    style={{
      data: { stroke: "#c43a31" },
      parent: { border: "1px solid #ccc"},

    }}
    data={data}
  />
</VictoryChart>
</div>
      </header>
    </div>
  );
}

export default App;
